import React from "react";
import style from "./DayOne.module.css";

import BackArrow from "./../BackArrow";
import Header from "./../../Header";
import HotelImage from "./../../../../images/Hotel.png";

function DayOne() {
  return (
    <div>
      <Header content={"Jour 1"} />
      <div className={style.hotelInfo}>
        <img src={HotelImage} alt="HotelImage" className={style.hotelImage} />
        <p>
          Nous allons rester à l'hôtel Fairmont Le Château Frontenac. C'est un
          hôtel magnifique dans le Vieux-Québec. Nous allons aller à la piscine,
          ou dîner au restaurant dans l’hôtel.
        </p>
      </div>
    </div>
  );
}

export default DayOne;
